import React from "react";
import Logo from '../assets/pizzaLeft.jpeg'

function Navbar() {
  return (
    <div className="navbar">
      <div className="leftSide">
        <img srx={Logo} />
      </div>
      <div className="rightSide"></div>
    </div>
  );
}

export default Navbar;
